//create and display purchase module
function interact(id) {
  let mod = document.createElement('comp-purchase');
  mod.setAttribute('img', phils[id].image_url);
  mod.setAttribute('title', 'v3phunk #' + id);
  mod.setAttribute('owner', '0x1234567890poiuyt');
  mod.setAttribute('truncatedOwner', '0x..00');
  mod.setAttribute('metadata', phils[id].md);
  mod.setAttribute('price', '0.005');
  mod.setAttribute('bid', '0.003');
  mod.setAttribute('txnHistory', 'placeholder');
  document.getElementById('mod-wrapper').appendChild(mod);
};

//start temp list function
function list(x, lo, hi) {
  //document.getElementById('assets').replaceChildren();
  document.getElementById('assets').textContent = '';
  for(let i = lo; i < hi; i++) {
    let card = document.createElement('comp-card');
    card.setAttribute('img', x[i].image_url);
    card.setAttribute('id', x[i].tokenId);
    card.setAttribute('atts', x[i].atts);
    card.setAttribute('price', '0.005');
    document.getElementById('assets').appendChild(card);
  };
};
//end temp list function

//toggle class name 
function togl(id) {
  for(i in id) {
    document.getElementById(id[i]).classList.toggle('d-none');
  };
};

//trait filtering
function trait(x) {
  let val = document.getElementById(x).value;
  f[x] = val;
  ps = phils.filter(i => Object.entries(f).every(([k, v]) => i[k] === v));
  let d = document.getElementById('id').value;
  if (d != '') {
    psid = ps.filter(a => a.tokenId.toString().indexOf(d) > -1);
    list(psid, 0, Math.min(psid.length, 1000));
  } else {
    list(ps, 0, Math.min(ps.length, 1000));
  };
}

//id filtering
function pid(){
  let v = document.getElementById("id").value.toString();
  psid = ps.filter(a => a.tokenId.toString().indexOf(v) > -1);
  list(psid, 0, Math.min(psid.length, 1000));
}

//clear trait filters
function cleer(c) {
  document.getElementById(c).value = "";
  delete f[c];
  if (Object.keys(f).length < 1) {
    list(phils, 0, 1000);
  } else { 
    ps = phils.filter(i => Object.entries(f).every(([k, v]) => i[k] === v));
    list(ps, 0, Math.min(ps.length, 1000));
  };
}

